import { Link, useNavigate } from 'react-router-dom';
import React, { useState } from 'react';
import axios from 'axios';

function Home() {
  const [notificationMessage, setNotificationMessage] = useState('');
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const navigate = useNavigate();

  // Function to send notification
  const sendNotification = async () => {
    try {
      await axios.post('http://localhost:8000/api/notifications', { message: notificationMessage });
      console.log('Notification sent');
      setNotificationMessage('');
    } catch (error) {
      console.error('Error sending notification:', error);
    }
  };

  // Function to navigate to EditAdmin page
  const goToEditAdmin = () => {
    navigate('/edit-admin');
    setIsMenuOpen(false); // Close the menu after navigation
  };

  // Function to navigate to Approve page
  const goToApproveResidents = () => {
    navigate('/approve-residents');
    setIsMenuOpen(false); // Close the menu after navigation
  };

  // Function to toggle menu
  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'stretch', minHeight: '100vh', backgroundColor: '#f0f0f0', color: '#000' }}>
      {/* Header */}
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '20px' }}>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <img src="/path/to/profile-photo.jpg" alt="Profile" style={{ width: '40px', height: '40px', borderRadius: '50%', marginRight: '10px' }} />
          <span style={{ fontWeight: 'bold' }}>Roohullah</span>
        </div>
        <button onClick={toggleMenu} style={{ padding: '10px', cursor: 'pointer', backgroundColor: 'transparent', border: 'none', borderRadius: '5px', fontSize: '16px', color: '#333', fontWeight: 'bold', textDecoration: 'underline' }}>
          ☰ Menu
        </button>
      </div>

      {/* Body */}
      <div style={{ flex: 1, padding: '20px', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
        <div style={{ width: '100%', maxWidth: '600px' }}>
          <div style={{ backgroundColor: '#fff', color: '#000', padding: '20px', borderRadius: '10px', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)' }}>
            <h2 style={{ color: '#2980b9', marginBottom: '20px' }}>Generate Notification</h2>
            <textarea
              value={notificationMessage}
              onChange={(e) => setNotificationMessage(e.target.value)}
              placeholder="Enter notification message..."
              style={{ width: '100%', minHeight: '200px', marginBottom: '20px', padding: '8px', borderRadius: '5px', border: '1px solid #ccc' }}
            />
            <button onClick={sendNotification} style={{ padding: '10px 20px', cursor: 'pointer', backgroundColor: '#2980b9', color: '#fff', border: 'none', borderRadius: '5px' }}>Send Notification</button>
          </div>
        </div>
      </div>

      {/* Footer */}
      <div style={{ display: 'flex', justifyContent: 'center', padding: '20px' }}>
        <Link to="/" style={{ padding: '10px 20px', textDecoration: 'none', color: '#2980b9', borderRadius: '5px', border: '1px solid #2980b9' }}>Logout</Link>
      </div>

      {/* Menu */}
      <div className="nav__menu" style={{ position: 'fixed', top: 0, right: isMenuOpen ? 0 : '-100%', backgroundColor: 'rgba(0, 0, 0, 0.2)', backdropFilter: 'blur(16px)', WebkitBackdropFilter: 'blur(16px)', width: '80%', height: '100%', padding: '6rem 3rem 0', transition: 'right 0.4s' }}>
        <button onClick={goToEditAdmin} style={{ marginBottom: '10px', padding: '10px 20px', cursor: 'pointer', backgroundColor: '#2980b9', color: '#fff', border: 'none', borderRadius: '5px', width: '100%', display: 'block', textAlign: 'center' }}>Edit Profile</button>
        <button onClick={goToApproveResidents} style={{ marginBottom: '10px', padding: '10px 20px', cursor: 'pointer', backgroundColor: '#2980b9', color: '#fff', border: 'none', borderRadius: '5px', width: '100%', display: 'block', textAlign: 'center' }}>Approve Residents</button>
        <button onClick={() => setIsMenuOpen(false)} style={{ padding: '10px 20px', cursor: 'pointer', backgroundColor: '#ccc', color: '#333', border: 'none', borderRadius: '5px', width: '100%', display: 'block', textAlign: 'center' }}>Logout</button>
      </div>
    </div>
  );
}

export default Home;
